import React,{useState,useRef} from 'react'
import '../styles/Contact.scss'
import Navbar from '../components/Navbar'
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import emailjs from 'emailjs-com';
function Contact() {
  const [email,setEmail] = useState("")
  const [message,setMessage] = useState("")
  const form = useRef();

  const handleEmailChange= (e) => {
    setEmail(e.target.value)
  }
  const handleMessageChange= (e) => {
    setMessage(e.target.value)
  }

  const submitForm = (e) =>{
    e.preventDefault();
    const regex = /^(([^<>()[\]\.,;:\s@\"]+(\.[^<>()[\]\.,;:\s@\"]+)*)|(\".+\"))@(([^<>()[\]\.,;:\s@\"]+\.)+[^<>()[\]\.,;:\s@\"]{2,})$/i;
    if(email != "" && message != "" && regex.test(email) === true){

      const prom = emailjs.sendForm('service_9mt25tu', 'template_843g9sa', form.current, 'Z9kM15QKlOsaZtD14')
      .then((result) => {
          f

orm.current.email.value = "";
          form.current.message.value = "";
      }, (error) => {
          // console.log(error.text,"error");
          // toast("An error occured, try again soon or check other contact means",{
          //   position: "top-right",
          //   hideProgressBar : true,
          //   // theme: "dark",
          //   type: "error",
          //   closeOnClick: true,
          // });
      });

      toast.promise(prom,{
        pending: 'Wait the email is being sent',
        success: 'Thanks for the message! Nick will answer you soon via your email',
        error: 'An error occured, try again soon or check other contact means',
        position: "top-right",
        hideProgressBar : true,
        // theme: "dark",
        type: "success",
        closeOnClick: true,
      });

    }else{
      toast("Provide full message content please!",{
        position: "top-right",
        hideProgressBar : true,
        // theme: "dark",
        type: "warning",

      closeOnClick: true,
    });
  }
}
return (
  <div>
    <ToastContainer />
    <Navbar about={false} portfolio={false} contact={true}/>
    <div className='contact'>
      <form ref={form}>
        <input type="email" placeholder='nick@gmail.com' name="email" onChange={handleEmailChange}/>
        <textarea placeholder='My message is . . .' name="message" minLength={10} onChange={handleMessageChange}/>
